import React, { Component } from 'react';
import { ClientData } from 'shared/api/clientData';
import { CollectionTable } from 'components/common/displayData/table/table';

export class CollectionList extends Component {


    data = () => {
        return [
            {
                'symbol': 'SNAP',
                'price_open': '14.01',
                'day_high': '14.14',
                'day_low': '13.96',
                'close_yesterday': '14.09',
                'volume': '4505528',
            }
        ]
    }

    render() {
        return (
            <CollectionTable data={this.data()}/>
        );
    }
}
